import React, { Component } from 'react';
import { BrowserRouter as Router,Route } from 'react-router-dom';
import { Link } from 'react-router-dom';
import Test from './test';
import Test1 from './test1';
import Test2 from './test2';
import logo from '../../zyinno.png';

//定义一个React组件
class Top extends Component {

  constructor(props){
    super(props);
    this.state={
      users:[],
      isLoaded:false,
      userName:''
    }
  }

  render() {  //React组件中必须有一个render函数
    return (
      <div>
        <div className="ZY-top">
          <img src={logo} className="ZY-logo" alt="logo" />
          <Router>
            <div>
              <Route path="/" component={Test}></Route>
              <Route path="/test1" component={Test1}/>
              <Route path="/test2" component={Test2}/>
            </div>
          </Router>
          <ul>
            <li>
              <Link to="/Test1">关于智宇</Link>
              {/* <a href="main/test.html" target="_self" title="关于智宇">关于智宇</a> */}
            </li>

            <li>
              <a href="main/top.html" target="_self" title="智宇未来">智宇未来</a>
            </li>

            <li>
              <a href="main/fotter.html" target="_self" title="产品介绍">产品介绍</a>
            </li>
            <li>
              <a href="/about/viewCategoryPage?categoryId=108" target="_self" title="服务对象">服务对象</a>
            </li>
            <li>
              <a href="/about/viewCategoryPage?categoryId=108" target="_self" title="联系我们">联系我们</a>
            </li>
          </ul>
        </div>
        
        </div>
    );}
}

export default Top;
